docs/callLogin.html.body:
callLogin

解释
发出登陆的指令，注意登陆成功后客户端会fire一个login事件
调用方法
Sailer.callLogin(&#39;&#39;, successcall, failcall);
返回
返回登陆成功后的UserInfo
    {
    returnCode: &#39;0000&#39;,
    returnMsg: &#39;调用成功&#39;,
    data: {
        uid: &#39;&#39;,
        sn: &#39;&#39;,
        appver: &#39;&#39;,
        chr: &#39;&#39;,
        token: &#39;&#39;
    }
}

docs/callLogout.html.body:
callLogout

